import React, { useState } from "react";
import AuthContainer from "./Auth/AuthContainer";
import TicketManagement from "./Components/TicketManagement";
import HelpIcon from "./Components/HelpIcon";
import ChatIcon from "./Components/ChatIcon";
import Home from "./Components/home/home";
import Payment from "./Components/payment/Payment"; 
import "./Styles/App.css";

const App: React.FC = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [currentPage, setCurrentPage] = useState("home");

  const handleLoginSuccess = () => {
    setIsAuthenticated(true);
    setCurrentPage("ticketManagement");
  };

  const renderPage = () => {
    switch (currentPage) {
      case "home":
        return <Home />;
      case "auth":
        return <AuthContainer onAuthSuccess={handleLoginSuccess} />;
      case "ticketManagement":
        return isAuthenticated ? <TicketManagement /> : <AuthContainer onAuthSuccess={handleLoginSuccess} />;
      case "payment":
        return <Payment />;
      default:
        return <Home />;
    }
  };

  return (
    <div>
      <nav>
        <button onClick={() => setCurrentPage("home")}>Trang chủ</button>
        <button onClick={() => setCurrentPage("auth")}>Đăng nhập</button>
        <button onClick={() => setCurrentPage("ticketManagement")}>Quản lý vé</button>
        <button onClick={() => setCurrentPage("payment")}>Thanh toán</button>
      </nav>
      {renderPage()}
    </div>
  );
};

export default App;
